webpackJsonp([0xcb4e208bfb7d],{325:function(e,n){e.exports={data:{markdownRemark:{html:'<p><img src="https://i.imgur.com/3mglRIK.png" alt="alt text" title="EcoSnap Website"></p>\n<blockquote>\n<p><a href="https://iamchrisjp.github.io/ecosnap/">Hjemmesiden kan findes her</a></p>\n</blockquote>\n<p>Totalt redesign af brand, visuel identitet og hjemmeside for startup virksomhed i Odense. Hjemmesiden er udviklet med <strong>flexbox</strong> for at skabe responsivitet så hjemmesiden, også så den er brugbar på håndholdte endheder, hvilket målgruppen gøre meget brug af.</p>\n<p>Overordnet set har elementerne en <em>container</em>, som får <strong>flex</strong> værdien, for at gøre det muligt for de indre elementer at agere ift. de parameter som <em>flexbox</em> giver os. De indre elementer har en <em>order</em> værdi som forklarer, hvilken rækkefølge, de skal placeres i, når siden bliver skaleret ned. Samtidig har det indre element selv elementer med værdien <em>flex</em>, som derefter bliver placeret i en <strong>column</strong> for at arrangere elementerne lodret.</p>\n<pre><code>#product-content-container {\n  display: flex;\n  padding: 8rem 4rem;\n  justify-content: center;\n}\n\n#phase-one {\n  display: flex;\n  flex-direction: column;\n  order: 1;\n}\n</code></pre>\n<p><img src="https://i.imgur.com/EcxVJne.png" alt="alt text" title="Flex Øvelses Website"></p>\n<blockquote>\n<p><a href="https://iamchrisjp.github.io/Jupiter_recreation/">Hjemmesiden kan findes her</a></p>\n</blockquote>\n<p>En genskabelse af <strong>Jupiter</strong> hjemmesiden, der bruger de samme <strong>flexbox</strong> egenskaber til at gøre hjemmesiden skalerbar som i projektet foroven .</p>\n<pre><code>#teaser-content-container {\n  display: flex;\n  justify-content: space-around;\n  align-items: center;\n  margin-top: 10rem;\n}\n\n#teaser-content-container img {\n  margin-left: 12rem;\n  order: 1;\n}\n\n#teaser-content {\n  display: flex;\n  flex-direction: column;\n  width: 20rem;\n  margin-right: 12rem;\n  order: 2;\n}\n</code></pre>',frontmatter:{date:"July 12, 2017",path:"/flex",title:"Diverse projekter"}}},pathContext:{}}}});
